    super(props);
    this.state = {
      lawyers: "hi",
    };
  }
  componentDidMount = () => {
    const url = "/lawyersReporter";
    Axios.get(url).then((response) => {
      //console.log(response.data.tem_c);
      console.log(response.data);
      //fetch();
    });
  };

  render() {
    return (
      <div className="topic">
        This is the list of lawyers:{this.state.lawyers}
      </div>
    );
  }
}

export default law_report;
